import React from "react";
import { useState, useEffect } from "react";
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import Link from '@mui/material/Link';
import { styled } from '@mui/material/styles';
import useScrollTrigger from '@mui/material/useScrollTrigger';
import { Typography } from "@mui/material";
import { makeStyles } from '@mui/styles';

import { Link as RouterLink} from "react-router-dom";

import logo from '../../assets/logo2.jpg'
import theme from "../UI/Theme";

function ElevationScroll(props) {
  const { children } = props;
  const trigger = useScrollTrigger({
    disableHysteresis: true,
    threshold: 0,
  });

  return React.cloneElement(children, {
    elevation: trigger ? 4 : 0,
  });
}

const useStyles = makeStyles(theme => ({
  toolbarMargin: {
    ...theme.mixins.toolbar
  },
  logo: {
    height: "2em",
    paddingLeft: "8px"
  },
  tabContainer: {
    marginLeft: "auto",
    marginRight: "auto"
  },
  tab: {
    fontWeight: 900
  }
}))

const ContainedButton = styled(Button)({
  ...theme.typography.buttonCustomization,
  color: "white",
  boxShadow: "none"
})

const OutlinedButton = styled(Button)({
  ...theme.typography.buttonCustomization
})

const Header = (props) => {
  const classes = useStyles();
  const [value, setValue] = useState("one");

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  useEffect(() => {
    if (window.location.pathname === "/" && value !=="one") {
      setValue("one")
    } else if (window.location.pathname === "/innovation-lab" && value !=="two") {
      setValue("two")
    } else if (window.location.pathname === "/submission-form" && value !=="three") {
      setValue("three")
    } else if (window.location.pathname === "/tech-connect" && value !=="four") {
      setValue("four")
    } else if (window.location.pathname === "/about-us" && value !=="five") {
      setValue("five")
    } else if (window.location.pathname === "/contacts" && value !=="six") {
      setValue("six")
    } 
  }, [value]);

  return (
    <React.Fragment>
      <ElevationScroll>
        {/* <Box sx={{ flexGrow: 1 }}> */}
          <AppBar position="fixed">
            <Toolbar disableGutters={false}>
              <Link component={RouterLink} to="/" underline="none" onClick={() => setValue("one")}>
                <Stack direction="row">
                  <Typography variant="h3" color="black">FINTECHPORT</Typography>
                  <img alt="company logo" src={logo} className={classes.logo} />
                </Stack>
              </Link>
              <Tabs
                value={value}
                onChange={handleChange}
                textColor="secondary"
                indicatorColor="secondary"
                aria-label="secondary tabs example"
                className={classes.tabContainer}
              >
                <Tab 
                  value="one" 
                  label="Home" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/"
                />
                <Tab 
                  value="two" 
                  label="Innovation Lab" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/innovation-lab"
                />
                <Tab 
                  value="three" 
                  label="Submit an Idea" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/submission-form"
                />
                <Tab 
                  value="four" 
                  label="What's New" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/tech-connect"
                />
                <Tab 
                  value="five" 
                  label="About Us" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/about-us"
                />
                <Tab 
                  value="six" 
                  label="Our Contacts" 
                  className={classes.tab}
                  component={RouterLink}
                  to="/contacts"
                />
              </Tabs>
              <Stack spacing={2} direction="row">
                <ContainedButton variant="contained" color="secondary">Log In</ContainedButton>
                <OutlinedButton variant="outlined" color="secondary">Sign Up</OutlinedButton>
              </Stack>
            </Toolbar>
          </AppBar>
        {/* </Box> */}
      </ElevationScroll>
      <div className={classes.toolbarMargin}/>
    </React.Fragment>
  )
}

export default Header;
